import {  H2, ButtonArrow, DateField } from "govuk-react";

function BookTab(){

  return(

    <div>

      <br />

      <H2>Book Appointment</H2>
    
      <DateField defaultValues={{day: '28',
    month: '02',
    year: '2024'
  }}
>
  What is your date of birth?
</DateField>
      <ButtonArrow>Make Appointment</ButtonArrow>
  </div>
    
    )};

export default BookTab;
